# In[4]:


game_input = tf.keras.layers.Input(shape=(72,))
knowledge_matrix = tf.keras.layers.Input(shape=(20,))
embedding = tf.keras.layers.Embedding(220+1, 15, input_length=72)(game_input)
lstm1 = tf.keras.layers.LSTM(32, return_sequences=True)(embedding)
lstm2 = tf.keras.layers.LSTM(32, return_sequences=True)(lstm1)
lstm3 = tf.keras.layers.LSTM(32, return_sequences=True)(lstm2)
lstm4 = tf.keras.layers.LSTM(32, return_sequences=False)(lstm3)
con=tf.keras.layers.Concatenate(axis=-1)([lstm4, knowledge_matrix])
dense1 = tf.keras.layers.Dense(64, activation='relu')(con)
dense2 = tf.keras.layers.Dense(32, activation='relu')(dense1)
output = tf.keras.layers.Dense(20, activation='sigmoid')(dense2)

model = tf.keras.models.Model(inputs=[game_input, knowledge_matrix], outputs=output)


